import React from "react";

const Redux = () => {
  return (
    <>
      <div className="container">
        <h1>ince or dec</h1>
        <div>
          <a className="quantity_minus" title="dec">
            <span>-</span>
          </a>
          <input
            className="quantity_input"
            type="text"
            name="quantity"
            value="0"
          />
          <a  href="" className="quantity_plus" title="inc">
            <span>+</span>
          </a>
        </div>
      </div>
    </>
  );
};

export default Redux;
